      <style>
        :root {
          --background: #ffffff;
          --foreground: #000000;
          --border: #cccccc; ;
          --bg-hover: #f0f0f0;
          --page-margin: 64px;
        }
        body {
          margin: 0;
          padding:0;
          font-family: 'Inter', sans-serif;
          font-size: 14px;
          background-color: var(--background);
          color: var(--foreground);
        }
        a:link, a:visited, a:hover, a:active {
          color: var(--foreground);
        }
        section.page {
          position: relative;
          border-bottom: 1px solid var(--border);
          height: 100vh;
        }
        section.page > div.nav {
          position: absolute;
          left: 0;
          right: 0;
          top: 0;
          height: 28px;
          padding: .5rem;
          display: flex;
          justify-content: space-between;
          align-items: center;
        }
        section.page > div.nav > div {
          display: flex;
          align-items: center;
        }
        section.page > div.nav > div > a.btn {
          width: 28px;
          height: 28px;
          border-radius: 6px;
          display: flex;
          justify-content: center;
          align-items: center;
        }
        section.page > div.nav > div > a.btn:hover {
          background-color: var(--bg-hover);
        }
        section.page > div.image {
          position: absolute;
          inset: var(--page-margin);
          display: flex;
          justify-content: center;
          align-items: center;
        }
        section.page > div.image > img {
          max-width: 100%;
          max-height: 100%;
          height: auto;
        }
      </style>
